    ImFontConfig getConfig(int oversampleH, int oversampleV) {
        ImFontConfig config;
        config.OversampleH = oversampleH;
        config.OversampleV = oversampleV;
        return config;
    }

    ImFont* LapisFonts::getRegularFont()
    {
        static ImFontConfig config = getConfig(5, 5);
        static ImFont* regularFont = ImGui::GetIO().Fonts->AddFontFromMemoryCompressedTTF(JostRegular_compressed_data,
            JostRegular_compressed_size, 20, &config);
        return regularFont;
    }

    ImFont* LapisFonts::getBoldFont()
    {
        static ImFontConfig config = getConfig(3, 3);
        static ImFont* boldFont = ImGui::GetIO().Fonts->AddFontFromMemoryCompressedTTF(JostSemiBold_compressed_data,
            JostSemiBold_compressed_size, 32, &config);
        return boldFont;
    }

    ImFont* LapisFonts::getTitleFont() {
        ImFontConfig config = getConfig(3, 3);
        static ImFont* titleFont = ImGui::GetIO().Fonts->AddFontFromMemoryCompressedTTF(JostSemiBold_compressed_data,
            JostSemiBold_compressed_size, 64, &config);
        return titleFont;
    }

    void LapisFonts::initFonts()
    {
        static bool alreadyInit = false;
        if (alreadyInit) {
            throw std::runtime_error("Only call initFonts once");
        }
        getRegularFont();
        getBoldFont();
        getTitleFont();
        ImGui::GetIO().Fonts->Build();

        alreadyInit = true;
    }
